import React, { Component } from 'react';
import '../styles.css';

class WindowUser extends Component{

    render() {
        return(
            <div className="container-window">
                <div className="container-Menu">
                    <button className="Menu-options">Perfil</button>
                    <button className="Menu-options">Mis viajes</button>
                    <button className="Menu-options">Pedir un viaje</button>
                </div>
                <div className="container-main">
                    <h3>Información de la cuenta</h3>
                    <p>Nombre</p>
                    <input id="name" type="text" placeholder="Nombre"/>
                    <p>Apellidos</p>
                    <input id="last-name" type="text" placeholder="Apellido"/>
                    <p>Celular</p>
                    <input id="cellphone" type="text" placeholder="Celular"/>
                    <p>Dirección</p>
                    <input id="address" type="text" placeholder="Dirección"/>
                    <p>Número de tarjeta</p>
                    <input id="nrocard" type="text" placeholder="Número de tarjeta"/>
                    <input type="submit" value="Seguir"/> 
                </div>
            </div>
        );
    }
}

export default WindowUser;
